INSERT INTO `News` (`NewsId`, `DateTime`, `Title`, `Message`) VALUES
(188, '2012-05-05 06:32:26', 'Controls updated', 'Fixed issue with IE and timer.  Also updated interface.'),
(189, '2012-06-15 07:32:26', 'First video issue', 'Fixed an issue with the first video where it would not start at the start time in Firefox and IE.'),
(187, '2012-05-03 09:25:11', 'Controls updated', 'Start button removed from main power hour and my mixes controls. Previous button added.  Mixes are now started up automatically on load.'),
(183, '2012-04-24 06:49:45', 'New mixes', 'A 70''s mix and a 90''s mix has been added: <a class="linkbutton" href="http://www.powerhourfactory.com/?mixid=240" target="_blank">http://www.powerhourfactory.com/?mixid=240</a> <a class="linkbutton" href="http://www.powerhourfactory.com/?mixid=241" target="_blank">http://www.powerhourfactory.com/?mixid=241</a>'),
(181, '2012-04-14 07:58:02', 'Your mixes', 'A mix can be created with less than 60 songs. However, you will have to access them under the My Mixes page when you''re logged in.  From there you can send your mix to anyone you want!'),
(186, '2012-05-02 18:28:16', 'Updates', 'New interface on control panel. Added auto complete drop down box and fixed some of the formatting.'),
(182, '2012-04-23 20:24:54', 'Activate issue', 'The issue with activating a new account is now fixed.'),
(185, '2012-04-27 13:40:22', 'New Mix', 'Rock and Alternative mix added:  <a href="http://www.powerhourfactory.com?mixid=246" class="linkbutton" target="_blank">http://www.powerhourfactory.com?mixid=246</a>'),
(190, '2012-06-15 07:32:49', 'Updates', 'Start page is now the video viewer instead of the welcome page'),
(191, '2012-10-13 07:04:56', 'New look', 'Updated layout and background.');
